import React from "react";

const BikeList = () => {

    // TODO: implement fetching
    let bikes = [
        {
            name: "Lastenrad 1"
        },
        {
            name: "Lastenrad 2"
        },
    ]

    return (
        <>
            <h1>Bike list</h1>


            {bikes.map((bike) => (

                <BikeListElement bike={bike}/>
            ))}
        </>
    );
};

export default BikeList;
